#include <iostream>

using namespace std;

int shrinkSize(string s);

int main(int argc, char *argv[]) {
	string s = "";
	char rs[] = {'A', 'C', 'B', 'E', 'D', 'G', 'F', 'I', 'H', 'K', 'J', 'M', 'L', 'O', 'N', 'Q', 'P', 'S', 'R', 'U', 'T', 'W', 'V', 'Y', 'X', 'Z'};
	
	char rl;
	unsigned minSize = -1;
	for (int i = 0; i < sizeof(rs); i++) {
		string s2 = s;
		for (int j = 0; j < s2.size(); j++) {
			if (s2[j] == rs[i] || s2[j] == rs[i] + 32) {
				s2.erase(j--, 1);
			}
		}
		
		int r = shrinkSize(s2);
		if (r < minSize) {
			rl = rs[i];
			minSize = r;
		}
	}
	
	
	cout << "Remove " << rl << " to reduce size to " << minSize << endl;
	return 0;
}

int shrinkSize(string s) {
	bool c = false;
	do {
		c = false;
		for (int i = 0; i < s.size() - 1; i++) {
			if (s[i] == s[i+1] + 32 || s[i] == s[i+1] - 32) {
				s.erase(i--, 2);
				c = true;
			}
		}
	} while (c);
	
	return s.size();
}